/* eslint-disable react/jsx-props-no-spreading */
import React from 'react';
import PropTypes from 'prop-types';
import { Route, Redirect } from 'react-router-dom';

import { store } from '../store';

export default function RouteWrapper({
  // eslint-disable-next-line react/prop-types
  component: Component,
  // eslint-disable-next-line react/prop-types
  isPrivate,
  ...rest
}) {
  const { signed, nivel } = store.getState().auth;

  if (signed) {
    switch (nivel) {
      case 0:
        return <Redirect to="/desafio-1" />;

      case 1:
        return <Redirect to="/desafio-2" />;

      case 2:
        return <Redirect to="/desafio-3" />;

      case 3:
        return <Redirect to="/desafio-4" />;

      case 4:
        return <Redirect to="/desafio-5" />;

      case 5:
        return <Redirect to="/desafio-6" />;

      case 6:
        return <Redirect to="/final" />;

      default:
    }
  } else {
    return <Redirect to="/re" />;
  }

  return <Route {...rest} render={props => <Component {...props} />} />;
}
// eslint-disable-next-line react/no-typos
RouteWrapper.PropTypes = {
  isPrivate: PropTypes.bool,
  component: PropTypes.oneOfType([PropTypes.element, PropTypes.func])
    .isRequired,
};
RouteWrapper.defaultProps = {
  isPrivate: false,
};
